import React, { useState } from 'react';
import './App.css';

function App() {
  // 1. Memory (State)
  const [tagId, setTagId] = useState('');
  const [dogData, setDogData] = useState(null);
  const [location, setLocation] = useState('');
  const [hospitalData, setHospitalData] = useState(null);

  // 2. Search Logic
  const handleDogSearch = () => {
    const mockDogs = [
      { DogID: "RED108", TagNumber: "108", Status: "VACCINATED", Date: "01-02-2026" },
      { DogID: "YELLOW220", TagNumber: "220", Status: "BOOSTER NEEDED", Date: "08-02-2025" }
    ];
    const result = mockDogs.find(d => d.DogID === tagId.toUpperCase());
    setDogData(result);
  };

  const handleHospitalSearch = () => {
    const mockHospitals = [
      { city: "KOCHI", name: "City Medical Center", distance: "0.8 km", phone: "+91 484 2345678" }
    ];
    const result = mockHospitals.find(h => h.city === location.toUpperCase());
    setHospitalData(result);
  };

  // 3. The Interface (The part that was causing the error)
  return (
    <div className="App">
      <header className="emergency-header">
        <h1>RabiesAware Dashboard</h1>
        <p>Immediate Response, Tag Verification & Community Reporting</p>
        <div className="emergency-actions">
          <button className="btn-emergency" onClick={() => window.open('tel:112')}>üìû CALL EMERGENCY (112)</button>
          <button className="btn-firstaid">ü©π FIRST AID STEPS</button>
        </div>
      </header>

      <main className="dashboard-grid">
        {/* LEFT COLUMN: Search Tools */}
        <section className="left-column">
          <div className="search-container tag-box">
            <h2>üîç Verify Vaccination Tag</h2>
            <div className="search-bar">
              <input type="text" placeholder="Enter Tag ID..." value={tagId} onChange={(e) => setTagId(e.target.value)} />
              <button className="btn-search blue" onClick={handleDogSearch}>VERIFY</button>
            </div>
            {dogData && (
              <div className="result-card dog-info">
                <h3>Status: {dogData.Status}</h3>
                <p>Tag No: {dogData.TagNumber} | Expiry: {dogData.Date}</p>
              </div>
            )}
          </div>

          <div className="search-container">
            <h2>üè• Find Nearby Medical Help</h2>
            <div className="search-bar">
              <input type="text" placeholder="Enter City..." value={location} onChange={(e) => setLocation(e.target.value)} />
              <button className="btn-search" onClick={handleHospitalSearch}>SEARCH</button>
            </div>
            {hospitalData && (
              <div className="hospital-card">
                <h3>üìç {hospitalData.name}</h3>
                <p>Distance: {hospitalData.distance}</p>
                <button className="btn-call">CALL HOSPITAL NOW</button>
              </div>
            )}
          </div>
        </section>

        {/* RIGHT COLUMN: Citizen Sighting Report */}
        <aside className="right-column">
          <div className="report-container">
            <h2>üì¢ Report Untagged Dog</h2>
            <p>Help the ABC Center locate unvaccinated dogs.</p>
            <form className="report-form" onSubmit={(e) => { e.preventDefault(); alert('Report Sent!'); }}>
              <label>Location of Sighting</label>
              <input type="text" placeholder="e.g. Near MG Road Metro" required />

              <label>Dog Description</label>
              <textarea placeholder="Color, size, behavior..." rows="3"></textarea>

              <label>Your Phone Number</label>
              <input type="tel" placeholder="For follow-up" />

              <button type="submit" className="btn-report">SUBMIT REPORT TO ABC</button>
            </form>
          </div>
        </aside>
      </main>
    </div>
  );
}

export default App;
